var expect = require('expect.js');
var server = require('../server');
var PublicMessageDao = require('../app/model/PublicMessageDao.js');
var md5 = require('md5');

function getDate(timestamp) {
    var tt = new Date(parseInt(timestamp) * 1000).toLocaleString();
    return tt;
}

function next(msglist) {
    console.log("Inside msglist");
}
suite('UploadImgVedio Test', function() {
    //initial test
    var sqlite3 = require("sqlite3").verbose();
    var file = "./chatroom.db";
    var date = new Date;
    var length = 0;
    var timestamp = Date.parse(new Date()) / 1000;

    var DB = new sqlite3.Database(file);
    PublicMessageDao = new PublicMessageDao(DB);
    var wallMsg = {
        name: "fiona",
        msg: "data:image/jpeg;base64,",
        ismsg:1,
        time: getDate(timestamp)
    };
    var wallMsg1 = {
        name: "lisa",
         msg:"data:video/quicktime;base64,",        
        ismsg:2,
        time: getDate(timestamp)
    };

    test('post and load image message', function(done) {
        //add new user
       PublicMessageDao.saveMessage(wallMsg);

     PublicMessageDao.getMessages(function(rows) {
            length = (rows.length - 1); {
                console.log("rows[i].src: " + length + rows[length].src);
                expect(rows[length].src).to.be("fiona");
                expect(rows[length].ismsg).to.be(1);
                expect(rows[length].content).to.be("data:image/jpeg;base64,");
            }
        });

        setTimeout(function() {
            done();
        }, 1500);
    });

 test('post and load vedio message', function(done) {
        //add new user
       PublicMessageDao.saveMessage(wallMsg1);

     PublicMessageDao.getMessages(function(rows) {
            length = (rows.length - 1); {
                console.log("rows[i].src: " + length + rows[length].src);
                expect(rows[length].src).to.be("lisa");
                expect(rows[length].ismsg).to.be(2);
                 expect(rows[length].content).to.be("data:video/quicktime;base64,");
            }
        });

        setTimeout(function() {
            done();
        }, 1500);
    });

});